import React from 'react';
import styled from 'styled-components';

const Icon = styled.div`
  width: 64px;
  height: 64px;
  background-color: #fff;
  border-radius: 6px;
`;

function ActivityIcon(icon) {
  return (
    <Icon href="/">
      <img src={icon} alt="icon" />
    </Icon>
  );
}

export default ActivityIcon;
